import React from 'react';
import { Line } from 'react-chartjs-2'


const Rechart = () => {
    return (
        <div className='mt-5'>
          <Line height={100} width={400} data={{
                    labels: ['voltage01', 'voltage02', 'voltage03', 'voltage04'],
                    datasets: [{
                        label: 'Voltage Data',
                        data: [27, 51, 32, 10,],
                        backgroundColor: [
                            'rgba(255, 99, 132, 0.2)',
                            'rgba(54, 162, 235, 0.2)',
                            'rgba(255, 206, 86, 0.2)',
                            'rgba(75, 192, 192, 0.2)',
                            'rgba(153, 102, 255, 0.2)',
                            'rgba(255, 159, 64, 0.2)'
                        ],
                        borderColor: [
                            'rgba(255, 99, 132, 1)',
                            'rgba(54, 162, 235, 1)',
                            'rgba(255, 206, 86, 1)',
                            'rgba(75, 192, 192, 1)',
                            'rgba(153, 102, 255, 1)',
                            'rgba(255, 159, 64, 1)'
                        ],
                        borderWidth: 1
                    }]
                }} />
      </div>
    );
};

export default Rechart;
